// api/api.js
import axios from 'axios';

export const fetchUserData = async (token) => {
    const getToken=()=>{
        return localStorage.getItem('USER_KEY');
    }

    return axios({
        method:'GET',
        url:`${process.env.hostUrl||'http://localhost:8080'}/api/v1/auth/userinfo`,
        headers:{
            'Authorization':'Bearer '+getToken()
        }
    })
  };
